import React from 'react';

class DashboardPage extends React.Component{
  componentDidMount(){
    firebase.database().ref().child('users').once("value").then(snapshot => {
      const result = snapshot.val()
      console.log(result)
    })
  }
  render(){
    return (
      <div>
          <h1>Dashboard</h1>
      </div>
    );
  }

};

export default DashboardPage;
